import React from 'react';
import "../style/components/_planningComp.scss";

const PlanningComp = () => {
    return (
        <div className="planning">
              <iframe src="https://calendar.google.com/calendar/embed?src=arnaud.meilhoc92%40gmail.com&ctz=Europe%2FParis" title="Planning Événements" width="1000px" heigh="500px" scrolling="no"></iframe>
        </div>
    );
};

export default PlanningComp;
